import React from "react";

import { connect } from "react-redux";
import { selectCollection } from "../../redux/products/product.selectors";

import "./product-details.styles.css";

const ProductDetails = ({ collection }) => {
  console.log("PRODUCT DETAILS", collection);
  return <div>PRODUCT DETAILS</div>;
};

const mapStateToProps = (state, ownProps) => {
  console.log("Product Details State", ownProps.match);
  return {
    collection: selectCollection(ownProps.match.params.collectionId)(state),
  };
};

export default connect(mapStateToProps)(ProductDetails);
